% % run the clear-sky detection routine.
% csd = Shen2018CSD(ghi,dni,dnics,aod,1); %plot figure set to 1 so an output is plotted
%
function csd = Shen2018CSD(dni,dnics,aod,plot_figure)
% safety checks
if ~iscolumn(dni)
    dni = dni';
    if ~iscolumn(dni)
        error('var dni must be a column vector')
    end
end
if ~iscolumn(dnics)
    dnics = dnics';
    if ~iscolumn(dnics)
        error('var dnics must be a column vector')
    end
end
if ~iscolumn(aod)
    aod = aod';
    if ~iscolumn(aod)
        error('var zen must be a column vector')
    end
end
if length(unique([length(dni),length(aod),length(dnics)]))~=1
    error('vars must be equal in length')
end

% Estimate aerosol extinction coefficient The Beer-Lambert law reveals the
% relationship between DNI and aerosol extinction coefficient at some wave
% length ?, as equation (1). EE ???z ( )=?toa ( ) e?? ? AM() (1) Ignoring
% the difference about aerosol extinction coefficient at any wave length,
% and take logarithm on both sides of the formula, the aerosol extinction
% coefficient can be approximately calculated in equation (2). ln ln 0 E I
% AM??=? ( )z (2) where I0 is the total solar irradiance, varying from 1363
% Wm/ 2 to 1368 Wm/ 2 . The 0I can be approximately represented by the
% average of total solar irradiance. Therefore, the aerosol extinction
% coefficient ? can be calculated if DNI and airmass are given. It is
% obvious that the larger the aerosol extinction coefficient is, the more
% attenuation is caused by aerosols, and the less DNI reaches at the
% ground. Hence, for clear sky, the aerosol extinction coefficient is not
% larger than a certain value.
% threshold for aersol extinction coefficient as 0.5
test1 = zeros(size(dni));
aod_limit = 0.5;
test1(aod<aod_limit)=1;

% Estimate convexity We can see obviously in figure 1 that before 12:00,
% clear sky DNI curve is approximately convex function about time, allowing
% a small range of noise; after 13:00, cloudy DNI curve fluctuates greatly
% and hardly has convexity. Therefore, we can estimate convexity to
% distinguish clear sky DNI curve from cloudy DNI curve.
noise_limit = 10; %Wm-2
% Jamie's interpretation

% 1) set a duration.
% 2) linearly fit irradiance between two points y(t) = ax(t)+b for both dni
%    and dnics.
% 3) if the slope is away from the clearsky considerably, that period is
%    cloudy, tolerance is 1.
% 4) note that when dni=0, then slope is also 0, which matches clearsky dni
%    at midday and so presents a further obstacle. An assumption is that there
%     must be at least 50wm2 of dni for this test to be valid
% 5) perform a check on all  if dni(t)+10 < y(t), then the value is below
%    convexity. Recall that y t is a straight line from the start of the
%    window to the end, this means that any fluxtuations are below the
%    line, as 10Wm2 is permissible, the dni is increased by 10 before the
%    check is made. Any point still below the line would mean that the
%    shape is "not convex". Note that this value of convexity is
%    generalised. If the legitimate value of convexity was assigned, it
%    would mean that the differences between irradiance datapoints must
%    always be monotonic, which is hardly ever true, and so a relaxed
%    boundary must exist. This is achieved through the tolerance and the
%    dni>50wm2 absolute cutoff, even though these are not defined in Shen's
%    paper. 
window_size = 10;
tolerance = 1;
dniw = hankel(dni,[dni(end),NaN(1,window_size-1)]);
dnicsw = hankel(dnics,[dnics(end),NaN(1,window_size-1)]);

rate_dni = (dniw(:,end)-dniw(:,1))./window_size;
rate_dnics = (dnicsw(:,end)-dnicsw(:,1))./window_size;
% y =ax+b; a = slopw_dni, b = dniw(:,1);
x = 0:window_size-1;
ydni = rate_dni.*x+dniw(:,1);

%  figure(1) % figure plot to visualise the test
%  ydnics = rate_dnics.*x+dnicsw(:,1);
%  start = 1.829e04;
% for i = start:start+2000
%     plot(x,dniw(i,:),x,dnicsw(i,:),x,ydni(i,:),x,ydnics(i,:))
%     legend('DNI','DNIcs','ydni','ydnics')
% %     ylim([200,1100])
%     pause(0.0001)
%     title(num2str(i))
% end

% slope check. This check asserts the slope from the whole window. 
test_temp1 = repmat(abs(rate_dni-rate_dnics)<tolerance,[1,window_size]).*1;
% noise check
test_temp2 = ((dniw+noise_limit) > ydni).*1;
test_temp3 = (dniw>50).*1;
test_temp = test_temp1 + test_temp2+test_temp3;
test2 = sum(test_temp,2);
test2(test2<3*window_size)=0;
test2(test2==3*window_size)=1;

% test1 = 1 if clear. test2 = 1 if clear. 
% build INVERSE!!! CSD from these criteria.
csd_inverse = zeros(size(dni));
csd_inverse(test1+test2 == 2)=1;
% Estimate duration Clear sky duration is not less than a certain length of
% time. After two steps above, if the aerosol extinction coefficient is not
% larger than a certain value and the DNI curve satisfies convexity for
% some time, we also need to estimate whether this duration is less than a
% certain length of time, for example, 1 hour. After the steps above, the
% samples with label one can be considered as clear sky data.
duration_threshold = 30; %hour
if mod(duration_threshold,2)~=0
    error('duration_threshold must be even')
end
durations = sum(hankel(csd_inverse,[csd_inverse(end),NaN(1,duration_threshold-1)]),2);
% durations is now a matrix of t-by-duration in size, each minute is clear
% if csd_inverse is 1, so a sum of this hankel will by 60 if the whole hour
% was clear.
% durations is the future hour. Therefore, we should offset the direct
% comparison by half the duration_threshold.
durations = [NaN(duration_threshold/2,1);durations(1:end-duration_threshold/2)];

%pre allocate the csd output
csd=ones(size(dni));

% if durations is 60, then the FUTURE hour was clear. 
csd(durations==duration_threshold)=0;

%% figure
if exist('plot_figure','var')
    figure('name','Shen CSD example','color','w');
    hold on
    plot(dni)
    CSD = dni;
    CSD(csd==1)=NaN;
    plot(CSD,'linewidth',2,'color','k')
    hold off    
    legend('DNI','Clear detected')
    ylabel('Irradiance [Wm^{-2}]')  
    set(gca,'xtick',[]);
    xlabel('Time')
end
end
